import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useLocation } from 'react-router-dom';

const Params = () => {
    const [params, setParams] = useState(null);
    const location = useLocation();
    const { token, chain, quote } = location.state;

    useEffect(() => {
        const fetchParams = async () => {
            try {
                const response = await axios.post('http://localhost:5000/params', { token, chain, quote });
                setParams(response.data);
            } catch (error) {
                console.error('Error fetching params:', error);
            }
        };

        fetchParams();
    }, [token, chain, quote]);

    return (
        <div>
            <h1>Transaction Parameters</h1>
            {params && (
                <div>
                    <p>Gas needed: {params.gas}</p>
                    {/* Display other parameters as needed */}
                </div>
            )}
        </div>
    );
};

export default Params;
